import sympy as sp
def aupto(n):
    x = sp.symbols('x')
    expr = (1 - x - sp.sqrt(1 - 2*x - 3*x**2)) / (x**2 * (3 - x - sp.sqrt(1 - 2*x - 3*x**2)))
    series_expr = sp.series(expr, x, 0, n).removeO()
    return sp.Poly(series_expr, x).all_coeffs()[::-1] # _Paul Muljadi_, Oct 10 2024

